import React, {Component} from 'react';
import {ABOUT_ME_TEXT} from "../config/configuration";

class AboutMe extends Component {
    render() {
        return (
            <div className={'about-me'}>
                <div className={'container mt-20'}>
                    <p>
                        {ABOUT_ME_TEXT}
                    </p>
                </div>
            </div>
        );
    }
}

export default AboutMe;
